import React from "react";
import "./fullpage.css";
import { withNavigationContext } from "react-awesome-slider/dist/navigation";
import Page from "../page/page"
import Particles from 'react-particles-js';

export const Home = withNavigationContext(({ fullpage }) => {
  return (
    <Page>
      <Particles
        params={{
          "particles": {
            "number": {
              "value": 50
            },
            "size": {
              "value": 3
            }
          },
          "interactivity": {
            "events": {
              "onhover": {
                "enable": true,
                "mode": "repulse"
              }
            }
          }
        }} />
      <p>This is home</p>
    </Page>
  );
});

export const PageTwo = withNavigationContext(({ fullpage }) => {
  return (
    <Page>
      <Particles
        params={{
          "particles": {
            "number": {
              "value": 160,
              "density": {
                "enable": false
              }
            },
            "size": {
              "value": 3,
              "random": true,
              "anim": {
                "speed": 4,
                "size_min": 0.3
              }
            },
            "line_linked": {
              "enable": false
            },
            "move": {
              "random": true,
              "speed": 1,
              "direction": "top",
              "out_mode": "out"
            }
          },
          "interactivity": {
            "events": {
              "onhover": {
                "enable": true,
                "mode": "bubble"
              },
              "onclick": {
                "enable": true,
                "mode": "repulse"
              }
            },
            "modes": {
              "bubble": {
                "distance": 250,
                "duration": 2,
                "size": 0,
                "opacity": 0
              },
              "repulse": {
                "distance": 400,
                "duration": 4
              }
            }
          }
        }} />
      <p>This is second page</p>
    </Page>
  )
});

export const PageThree = withNavigationContext(({ fullpage }) => {
  return (
    <Page>
      <p>This is third page</p>
    </Page>
  )
});

export const media = [
  {
    slug: "",
    className: "slide page-one",
    children: <Home />
  },
  {
    slug: "page-two",
    className: "slide page-two",
    children: <PageTwo />

  },
  {
    slug: "page-three",
    className: "slide page-three",
    children: <PageThree />
  }
];
